import React from 'react';


const WizardField =() =>{

    return(
        <div>
            <label>
                label:
            </label>
                    <input 
                        type="text"
                        value={this.state.name } 
                        onChange={(e)=>this.setState({name:e.target.value})}
                    />
        </div>
    );
}

export default WizardField;
